import styled from "styled-components";

export const Container = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: space-between;
  height: 20px;
  padding: 6px;
  position: absolute;
  top: 5;
  left: 0;

  @media (min-width: 768px) {
    display: none;
  }
`;
export const Line = styled.div`
  width: 30px;
  height: 3px;
  background-color: black;
`;
